window.bookSummaryJSON = "<p><b>Five possessive Fae males who'll do anything to claim their fated mates</b><br> <b>Binge all five books in the Fae's Claim Series in one boxset. </b><br> <b>Includes bonus scenes.</b> </p> <p><b>Mine to protect. Mine to claim.... She is </b><b><i>mine.</i></b></p> <p>DANTE </p> <p>I'm a trained assassin. Enlisted by the Fae Corps and instructed to kill, there is no place in my life for a fated mate. <br> Then Gia crashes into my life. <br> Flashing eyes, <br> luscious lips that beg to be kissed. <br> One whiff of her sugary scent, and I know she is mine. <br> But she's human, and no way can she withstand the mating practices of the Fae. <br> I am too lethal, <br> I should stay away. <br> When she takes the hit meant for my target, I cannot let her die. <br> So I do the only thing that will save her life.... <br> I form a soul-bond with the unconscious human. <br> I want to make her bend to my will. <br> I hadn't reckoned with craving her emotions, her feelings. Her love.... <br> When she breaks out of my lair, I will do anything to get her back. <br> This time I will make her give in to me. <br> This time she cannot escape, <br> Gia is MINE </p> <p><b>Note: This boxset contains all five books in the completed Fae's Claim Series </b> </p> <p><i>Stolen by the Fae (Dante and Gia)</i> - Amazon Top 200 Bestseller <br> <i>Property of the Fae (Tristan and Jess) </i><br> <i> Seduced by the Fae (Doc and Alice) </i><br> <i> Knotted by the Fae (Gabriel and Lily) </i><br> <i> Kidnapped by the Fae (Hawke and Charley)</i> </p> <p><b>Features five snarly, possessive, Fae males, intensely emotional scenes, and twists that will keep you gasping for more. Buy now.</b> </p>"; 
